import React from "react";
import "./home.css";

const ProfileCards = () => {
  const slides = [
    { image: "/images/slider1.jpg" },
    { image: "/images/slider2.jpg" },
    { image: "/images/slider3.jpg" }
  ];

  return (
    <div className="main-container">
      {/* Text container on the left */}
      <div className="container_h2">
        <h2>Heading Text Here</h2>
        <p>Some description or content goes here on the left side.</p>
      </div>

      {/* Image cards container on the right */}
      <div className="container_h1">
        {slides.map((slide, index) => (
          <div
            key={index}
            className={`profile-card card-${index + 1}`}
            style={{
              backgroundImage: `url(${slide.image})`,
              backgroundRepeat: "no-repeat",
              backgroundPosition: "center",
              backgroundSize: "cover"
            }}
          >
            <div className="content">
              <span>Card {index + 1}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProfileCards;
